import React from 'react';
import './Footer.scss';
import SocialMedia from '../SocialMedia/SocialMedia';
import Link from '@material-ui/core/Link';
import Typography from '@material-ui/core/Typography';


function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © '}
      <Link color="inherit" href="/">
        Kataleya
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}



const footer = () => (
  <footer className="footer">
   {/*  <div className="questions">
      <div className="questions-wrapper">
        <div className="questions-text">
          <h3 className="title">Questions</h3>
          <p className="subtitle">Lorem ipsum dolor sit amet, consectetur adipiscing elit. In tempus massa ac pretium dapibus. Proin consectetur eros id suscipit tristique. </p>
        </div>

      </div>
    </div> */}

    <div className="support-section">
      <div className="support-wrapper">
      <div className="Address">
          <h4>Address</h4>
          <p>here</p>
          <p>there</p>
          <p>everywhere</p>
          <p>kahlil</p>
          <p>khelo</p>
        </div>
        <div className="online-shop">
          <h4>Online Shop</h4>
          <p>How to Buy</p>
          <p>Questions</p>
          <p>Sales</p>
          <p>Delivery cost</p>
          <p>Regulations</p>
        </div>
        <div className="about-us">
          <h4>About Us</h4>
          <p>Who We Are</p>
          <p>Work with Us</p>
          <p>Social Media</p>
          <p>Our Stores</p>
        </div>
        <div className="support">
          <h4></h4>
        </div>
      </div>
      <SocialMedia />
    </div>
    <p className="advertising"> { <Copyright />}</p>
  </footer>
);

export default footer;
